import { Grid } from "@mui/material";
import React from "react";

export const Home = () => {
  return (
    <Grid container spacing={2}>
      <Grid item xs={12}>
        <img
          src="data:image/jpeg;base64,"
          alt=""
          height={100}
          width="100%"
        />
      </Grid>
    </Grid>
  );
};
